%sql
DROP TABLE IF EXISTS AIRLINE_DESTINATION_LOOKUP;
DROP TABLE IF EXISTS AIRLINE_ORIGIN_LOOKUP;

create table AIRLINE_DESTINATION_LOOKUP
USING row as (select destiata, destlatitude, destnlongitude from app.airline_destination where destiata is not null);

create table AIRLINE_ORIGIN_LOOKUP
USING row as (select originiata, originlatitude, originlongitude from app.airline_origin where originiata is not null);

