CREATE EXTERNAL TABLE FHIR_ORIGINAL.staging_patients USING csv OPTIONS (path '../../data/FHIR/csv/patients.csv', header 'true', inferSchema 'true'); 
CREATE EXTERNAL TABLE FHIR_ORIGINAL.staging_encounters USING csv OPTIONS (path '../../data/FHIR/csv/encounters.csv', header 'true', inferSchema 'true'); 
CREATE EXTERNAL TABLE FHIR_ORIGINAL.staging_allergies USING csv OPTIONS (path '../../data/FHIR/csv/allergies.csv', header 'true', inferSchema 'true'); 
CREATE EXTERNAL TABLE FHIR_ORIGINAL.staging_careplans USING csv OPTIONS (path '../../data/FHIR/csv/careplans.csv', header 'true', inferSchema 'true'); 
CREATE EXTERNAL TABLE FHIR_ORIGINAL.staging_conditions USING csv OPTIONS (path '../../data/FHIR/csv/conditions.csv', header 'true', inferSchema 'true'); 
CREATE EXTERNAL TABLE FHIR_ORIGINAL.staging_imaging_studies USING csv OPTIONS (path '../../data/FHIR/csv/imaging_studies.csv', header 'true', inferSchema 'true'); 
