CREATE EXTERNAL TABLE FHIR_ORIGINAL.staging_providers USING csv OPTIONS (path '../../data/FHIR/csv/providers.csv', header 'true', inferSchema 'true'); 

CREATE TABLE FHIR_ORIGINAL.patients using column options (PARTITION_BY 'ethnicity', buckets '12') as (select * from FHIR_ORIGINAL.staging_patients); 
CREATE TABLE FHIR_ORIGINAL.encounters using column options (PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_encounters); 
CREATE TABLE FHIR_ORIGINAL.allergies using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_allergies); 
CREATE TABLE FHIR_ORIGINAL.conditions using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_conditions); 
CREATE TABLE FHIR_ORIGINAL.imaging_studies using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_imaging_studies); 
CREATE TABLE FHIR_ORIGINAL.immunizations using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_immunizations); 
CREATE TABLE FHIR_ORIGINAL.observations using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_observations ORDER BY DATE); 
CREATE TABLE FHIR_ORIGINAL.procedures using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_procedures ORDER BY DATE);
CREATE TABLE FHIR_ORIGINAL.procedures_active using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12') as (select * from FHIR_ORIGINAL.staging_procedures ORDER BY DATE LIMIT 1);

CREATE TABLE FHIR_ORIGINAL.organizations as (select * from FHIR_ORIGINAL.staging_organizations); 
CREATE TABLE FHIR_ORIGINAL.providers as (select * from FHIR_ORIGINAL.staging_providers); 

CREATE TABLE FHIR_ORIGINAL.medications
(
START varchar(40),
STOP varchar(40),
PATIENT varchar(40),
ENCOUNTER varchar(40),
CODE long,
DESCRIPTION varchar(60),
COST double,
DISPENSES int,
TOTALCOST double,
REASONCODE long,
REASONDESCRIPTION varchar(60))
using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12'); 

INSERT INTO FHIR_ORIGINAL.medications SELECT * FROM FHIR_ORIGINAL.staging_medications; 

CREATE TABLE FHIR_ORIGINAL.careplans
(
ID varchar(40), 
START varchar(40), 
STOP varchar(40), 
PATIENT	varchar(40), 
ENCOUNTER varchar(40), 
CODE long,
DESCRIPTION	varchar(40), 
REASONCODE long, 
REASONDESCRIPTION varchar(60))
using column options(PARTITION_BY 'PATIENT', colocate_with 'FHIR_ORIGINAL.PATIENTS', buckets '12'); 
INSERT INTO FHIR_ORIGINAL.careplans SELECT * FROM FHIR_ORIGINAL.staging_careplans; 

SELECT * FROM FHIR_ORIGINAL.careplans LIMIT 1;
